"'The practice of government by means of virtue may be compared to the polestar, which the multitudinous stars pay homage to while it stays in its place.' Hence the meaning of the concept of 'revolution,' which is the motion occurring around an 'unmoved mover' . . . In this sense royalty assumes the value of a 'pole'" - Julius Evola with a citation from Confucius
