Royalty is truly the pole about which civilization turns, and thus, the monarch serves as both a unifying and elevating force, directing his subjects toward the divine. As such, it may be said that "Heaven is his Father, Earth his Mother" (Gu√©non); he truly fulfills a mediatory function as the "Son of Heaven and Earth" who is situated at "the central point where the powers of Heaven and Earth actually unite" (Gu√©non). Thus, "the 'act' in him must be equal to the 'potency,' which implies the integral realization of his humanity, that is to say the very condition of 'true man'" (Gu√©non). The monarch is therefore perfectly balanced, uniting the functions of priest and warrior in harmony. He may then recognize Heaven as his True Ancestor and be considered an icon of it "in regard to all other manifested beings" (Gu√©non). This True Ancestor "is the man who is 'created in the image of God,' or more exactly in the image of Elohim or the celestial powers" (Gu√©non), which confirms that the divine force is immanently manifested within him. It is the acknowledgment of this truth that has led men to venerate kings so highly and to submit to them willingly, without force being applied. Only these great men, chosen by God to reflect his power, can create lasting order out of chaos and draw men toward the center, toward God Himself. Without such men, civilization gravitates toward disorder; men lose the sense of eternity, and turn toward vanities; true unity becomes impossible, and endless conflicts ensue. In such a world, like the modern epoch, the influence of the divine is greatly limited, and with its limitation, dark forces predominate while the land suffers. Through these constant limitations, man has effectively severed himself";}i:108;a:1:{s:14:"comments_count";i:2;}i:109;a:1:{s:11:"likes_count";i:0;}i:110;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEusYvxAXld";}i:111;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/